import React, { Component } from 'react';
import LandingPage from '../src/components/containers/LandingPage'
import NavBar from '../src/components/functional/NavBar'

class App extends Component {
  render() {
    return (
      <div className="app-container">
        <LandingPage />
        <NavBar />
      </div>
    );
  }
}

export default App;
